(83, 'If you’re lucky enough to be in Frankfurt at the time, you can find Jaguar in Hall 5, Stand B22.', 'gb', 'de', 'Wenn Sie Glück haben, in Frankfurt an der Zeit sein, sind, können Sie Jaguar in Halle 5, Stand B22. ', '2012-06-27 16:25:10'),
