(110, 1, 'IMPORTANT NOTICE', 2, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(111, 1, 'Jaguar Cars Limited is constantly seeking ways to improve the specification, design and production of its vehicles and alterations take place continually. Whilst every effort is made to produce up-to-date literature, this brochure should not be regarded as an infallible guide to current specifications, nor does it constitute an offer for the sale of any particular vehicle. Distributors and dealers are not agents of Jaguar Cars Limited and have absolutely no authority to bind Jaguar Cars Limited by any express or implied undertaking or representation. Illustrations in this brochure may include optional extras.', 93, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(112, 1, 'Comparisons are based on manufacturer’s own data and testing.', 10, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(113, 1, 'ENVIRONMENTAL INNOVATION AT JAGUAR', 4, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(114, 1, 'Jaguar is proud to continue the company’s tradition with its approach to Environmental Innovation. From the choice of lightweight materials and lean production methods to the efficiency of its engines and designs, Jaguar is committed to operating as a more sustainable business and reducing its overall environmental impact.', 49, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(115, 1, 'Jaguar’s flagship XJ model was the first in the company to achieve ISO 14040, the international standard for vehicle ‘whole life cycle’ assessment. This certification measures the environmental impact of XJ from component material sourcing and manufacturing process, through its driven life time, to final disposal. But that’s not all. Every new Jaguar vehicle is designed to be 85 percent recyclable and reusable, in addition 95 percent recoverable and reusable with 10 percent for energy generation.', 74, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(116, 1, 'The XJ and XK’s innovative use of lightweight aluminium, which incorporates up to 50% recycled material from the manufacturing process of the body structures, provides considerable performance benefits. This includes improved fuel consumption and less CO₂ emissions associated with lighter structures as well as the dynamic performance inherent in its weight saving design.', 53, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(117, 1, 'Jaguar is committed to reducing dependency on fossil fuels, using fewer resources and creating less waste. Already the manufacturing assembly CO', 21, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(118, 1, '₂', 0, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(119, 1, ' emissions of each Jaguar built in the UK since 2009 is offset. For every tonne of CO', 16, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(120, 1, ' emitted in the assembly process, Jaguar invests in carbon reduction projects that reduce an equivalent tonne of CO', 18, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(121, 1, ' elsewhere.', 1, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(122, 1, 'Offsetting allows Jaguar to take action now, to reduce its impact on the environment, as part of an integrated carbon management plan. This company plan includes targets to reduce operating CO', 31, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(123, 1, ' emissions and waste to landfill by 25 percent by 2012, water consumption by 10 percent by 2012 and fleet average exhaust CO', 18, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(124, 1, ' emissions by 25 percent by 2015, based on 2007 levels.', 7, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(125, 1, 'But it doesn’t stop there. World class manufacturing facilities certified to ISO 14001 since 1998, transport miles have been cut from delivery routes and new ways are being introduced to produce energy from food waste at our Gaydon site in the UK.', 41, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(126, 1, 'That’s Environmental Innovation at Jaguar.', 6, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(127, 1, 'Jaguar Cars Limited,', 3, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
