(132, 1, 'JLM/36/85/03/0412', 1, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(133, 1, 'XK Special Edition. Luxury and individuality in a performance car. The exhilaration of effortless power. Superb drivability and precise handling, matched with the refined calm of a Grand Tourer. Available with the 5.0 litre V8 in either Coupé or Convertible bodystyles. Designed to offer craftsmanship and a new level of exclusivity.', 50, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(134, 1, 'XK SPECIAL EDITION ', 3, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(135, 1, 'MAKES ITS DEBUT', 3, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(136, 1, 'The aluminium bodyshell is constructed using aerospace technology and advanced laser-guided robotics. The precisely engineered components are joined by self-piercing rivets, then bonded using high-adhesion, heat-cured specialist adhesives. The light, strong and exceptionally rigid monocoque structure that results is fundamental to the car’s performance. Acceleration is breathtaking. Handling is agile and precise.', 53, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(137, 1, 'TECHNOLOGY AND PRECISION', 3, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(138, 1, 'Every interior is crafted with meticulous attention to detail, with components designed to be as rewarding to touch as they are to look at. The steering wheel, for example, is covered with 0.25 m', 33, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(139, 1, '²', 0, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(140, 1, ' of leather, uses approximately 15 metres of thread and takes more than an hour to build. The leather inside the rim is stitched together by hand.', 25, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(141, 1, 'CRAFTMANSHIP AND DETAIL', 3, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(142, 1, 'Unique for XK Special Edition. 20 inch Venom diamond turned alloy wheels with a dark grey finish.', 16, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(143, 1, 'WHEELS', 1, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(144, 1, 'The place to be. For the passenger as much as it is for the driver.  The luxury Grand Tourer. It offers the finest materials and premium  finishes. It offers something truly special.', 32, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
