(154, 1, 'Quality and individuality. Fine materials and contemporary design. The Truffle interior colour theme offers the choice of Shadow Walnut or Dark Figured Aluminium veneers. The Performance seats are upholstered in a combination of soft grain and unique Scraffito grain leathers, with contrast micro-piping and a twin-needle contrast stitch. Scraffito grain leather also covers the surround of the instrument binnacle, the door centre panels and the back rests of the rear seats. On Coupé models the headlining is available in Canvas Poltrona Frau', 82, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
