(198, 1, 'Enabling you to personalise your car, to create a driving experience that is even more individually rewarding. All Jaguar accessories are tested rigorously for safety and durability in the most arduous of climates and conditions. The full range of Jaguar accessories is available to view on-line, please visit jaguar.com for further information.', 53, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(199, 1, 'Any genuine Jaguar Accessories (excluding gift items and luggage from Jaguar Collection) supplied and fitted by a Jaguar dealer within one month or 1,500km/1,000miles (whichever occurs first) of a new vehicle being put into service will benefit from the same warranty terms and duration as the Vehicle Warranty. Accessories purchased outside of this period will be subject to 12 month unlimited mileage warranty.', 63, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(200, 1, 'BECAUSE ONLY THE BEST WILL DO', 6, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(201, 1, 'An official Jaguar dealer or Approved Service Centre can ensure that Jaguar  trained, specialist technicians, with access to the full range of Jaguar approved  parts and tools, will always be on hand to guarantee that every fitting, or repair,  is carried out exactly the way Jaguar intended. Your Jaguar dealer or Approved Service Centre can also supply and fit Jaguar approved accessories to personalise and add to the practicality and style of your XK.', 74, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(202, 1, 'SERVICE AND ASSURANCE*', 3, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(203, 1, 'Complete peace of mind including Competitively Priced Servicing, Seasonal Health Checks and Total Tyre Care to ensure that your Jaguar XK retains its premium condition, delivering optimal performance.', 28, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(204, 1, 'WARRANTY*', 1, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
