(207, 1, 'Jaguar Magazine is the official magazine of Jaguar Cars. It features the new Jaguar XJ, XK and XF, and the worlds of luxury, style, design and travel. The fully interactive Jaguar Magazine iPad app takes the very best of the print edition of the Magazine and adds extra images, and exclusive information, allowing you to explore Jaguar’s world in a whole new way.', 64, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(208, 1, 'JAGUAR.COM', 2, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(209, 1, 'Jaguar’s official interactive website contains the latest information on Jaguar models and pricing. It also features helpful tools such as a dealer locator and a new model configurator allowing you to see the car tailored to your specification and colour.', 41, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(210, 1, 'JAGUAR FINANCIAL SERVICES*', 3, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
