(213, 1, '†All Jaguar Approved Accessories are rigorously tested to the same exacting standards as those applied to our vehicles. Performance in extreme hot and cold temperatures, corrosion resistance, impact and airbag deployment highlight some of the exhaustive product testing carried out so that Accessories are both durable and importantly, continue to comply with current legalisation.', 54, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
(214, 1, 'Service, assurance, and peace of mind are all part of the pride of owning your new XK.', 17, '2012-03-06 12:22:19', 7, 6, 5, 0, NULL, 0),
