(217, 1, 'PORTFOLIO PACK', 2, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(218, 1, 'Jaguar’s flagship XJ model was the first in the company to achieve ISO 14040, the international standard for vehicle ‘whole life cycle’ assessment. This certification measures the environmental impact of XJ from component material sourcing and manufacturing process, through its driven life time, to final disposal. But that’s not all. Every new Jaguar vehicle is designed to be 85% recyclable and reusable, in addition 95% recoverable and reusable with 10% for energy generation.', 71, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(219, 1, 'The XJ and XK’s innovative use of lightweight aluminum, which incorporates up to 50% recycled material from the manufacturing process of the body structures, provides considerable performance benefits. This includes improved fuel consumption and less CO', 36, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(220, 1, ' emissions associated with lighter structures as well as the dynamic performance inherent in its weight saving design.', 17, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(221, 1, 'Jaguar is committed to reducing dependency on fossil fuels, using fewer resources and creating less waste. Already  the manufacturing assembly CO', 21, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(222, 1, ' emissions and waste to landfill by 25% by 2012, water consumption by 10% by 2012 and fleet average exhaust CO', 16, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(223, 1, ' emissions by 25% by 2015, based on 2007 levels. ', 6, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
