(227, 1, 'The new XK Portfolio Pack. Luxury and individuality in a performance car. The exhilaration of effortless power. Sports car performance and precise handling without sacrificing comfort or style. The new XK Portfolio Pack offers unique materials and hand crafted luxury. Available in two exclusive new interior colour combinations. The exterior features a selection of six striking colours, including Celestial Black - available exclusively with the new XK Portfolio Pack.', 69, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(228, 1, 'Available on XK and XKR and in both Coupe and Convertible bodystyles.', 12, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(229, 1, 'XK PORTFOLIO PACK', 3, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(230, 1, 'The luxury Grand Tourer. Tailored to the passenger as much as it is the driver. It offers exclusive choices, bespoke materials and unique finishes.', 24, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(231, 1, 'Navy soft grain leather', 4, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
