(233, 1, 'Dark Figured Aluminum ', 3, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(234, 1, 'Quality and individuality. Fine materials and contemporary design. A deliberate juxtaposition between tonal combinations outside and inside of the car to create harmony and accentuate the beauty and luxury of the interior. There are two interior colour themes, Navy and Truffle, each offering the choice of Shadow Walnut or Dark Figured Aluminum veneers and chosen to evoke a sense of refinement in accord with the XK Portfolio Pack’s unique identity. The interior is upholstered in soft grain leathers with a twin-needle contrast stitch. On Coupe models the headlining is available, for the first time on an XK, in either Jet or Canvas coloured Poltrona Frau® leather: a modern, high-grade leather renowned for its use on the finest furnishings. This is your personal space.', 124, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(235, 1, 'Unique to the Portfolio Pack, 20 inch Orona alloy wheels in a polished finish.', 13, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(236, 1, 'Every interior is crafted with meticulous attention to detail, with components designed to ', 13, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(237, 1, 'be as rewarding to touch as they are to look at. The steering wheel, for example, is covered ', 18, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(238, 1, 'with 2.7 square feet of leather and uses approximately 15 metres of thread. The leather rim ', 14, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(239, 1, 'is stitched together by hand.', 5, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(240, 1, 'The aluminum bodyshell is constructed using aerospace technology and advanced laser-guided robotics. The precisely engineered components are joined by self-piercing rivets, then bonded using high-adhesion, heat-cured specialist adhesives. The light, strong and exceptionally rigid monocoque structure that results is fundamental to the car’s performance. The acceleration is breathtaking. The handling is agile and precise.', 55, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(241, 1, 'Lightweight aluminum technology, powerful and refined engines and Jaguar’s lightning fast sequential shift system deliver thrilling performance and instant response. An array of intelligent systems, including JaguarDrive Control', 29, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
(242, 1, ', Adaptive Dynamics and Active Differential (XKR only), work together to complement the driver’s skills and tailor the driving experience to suit his or her preferences.', 26, '2012-03-06 12:22:45', 7, 6, 5, 0, NULL, 0),
