(293, 1, 'The passion we put into building our vehicles continues long after you drive away in one with an ownership program called Jaguar Platinum Coverage. For 4 years/80,000 kilometers on all 2013 Jaguar cars, Jaguar Platinum Coverage includes complimentary schedule maintenance, 4/80 New Vehicle Limited Warranty, No-Charge Replacement of Wear Items, and 24/7 roadside assistance. The only thing that surpasses the beauty of driving a Jaguar car is the beauty of owning one.', 68, '2012-03-06 12:22:46', 7, 6, 5, 0, NULL, 0),
