(305, 1, 'Jaguar ownership begins with a first class dealership experience. It continues with the outstanding support from dealership service teams dedicated to maintaining your vehicle’s condition and performance. You will find only the best factory-trained technicians at authorized Jaguar retailers.', 40, '2012-03-06 12:22:46', 7, 6, 5, 0, NULL, 0),
(306, 1, 'JAGUAR MERCHANDISE', 2, '2012-03-06 12:22:46', 7, 6, 5, 0, NULL, 0),
(307, 1, 'To extend Jaguar luxury to other facets of your life, we offer the Jaguar Collection, a beautiful range of products that carry the Jaguar name and logo. The collection features exclusive leisure and sporting wear, travel accessories, scale models and much more. Visit www.Jaguar.ca/collection or contact your local authorized Jaguar retailer for a merchandise collection catalog.', 59, '2012-03-06 12:22:46', 7, 6, 5, 0, NULL, 0),
(308, 1, 'JAGUAR VEHICLE ACCESSORIES', 3, '2012-03-06 12:22:46', 7, 6, 5, 0, NULL, 0),
