(310, 1, 'Jaguar vehicle accessories enable you to personalize your car, to create a driving experience that is even more individually rewarding. All Jaguar accessories are tested rigorously for safety and durability in the most arduous of climates and conditions. With a comprehensive range of styling options and interior and exterior accessories, you can tailor your Jaguar vehicle to suit your personal style. What’s more, every accessory is covered for 12 months unlimited mileage or the balance of the New Vehicle Limited Warranty, whichever is greater. Any genuine Jaguar Accessories (excluding gift items and luggage from Jaguar Collection) supplied and fitted by an authorized Jaguar retailer within one month or 1,000 miles (whichever occurs first) of a new vehicle being put into service will benefit from the same warranty terms and duration as the New Vehicle Limited Warranty. Accessories purchased outside of this period will be subject to 12 month unlimited mileage warranty.', 149, '2012-03-06 12:22:46', 7, 6, 5, 0, NULL, 0),
