(524, 1, 'Jaguar’s flagship XJ model was the first in the company to achieve ISO 14040, the international standard for vehicle ‘whole life cycle’ assessment. This certification measures the environmental impact of XJ from component material sourcing and manufacturing process, through its driven life time, to final disposal. But that’s not all. Every new Jaguar vehicle is designed to be 85% recyclable and reusable, in addition to 95% recoverable and reusable with 10% for energy generation.', 72, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(525, 1, ' elsewhere. Offsetting allows Jaguar to take action now, to reduce its impact on the environment, as part of an integrated carbon management plan. This company plan includes targets to reduce operating CO', 32, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(526, 1, ' emissions and waste to landfill by 25% by 2012, water consumption by 10% by 2012 and fleet average tailpipe CO', 16, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(527, 1, ' emissions by 25% by 2015, based on 2007 levels.', 6, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(528, 1, 'But it doesn’t stop there. World class manufacturing facilities certified to ISO 14001 since 1998, transport miles have been cut ', 19, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(529, 1, 'from delivery routes and new ways are being introduced to produce energy from food waste at our Gaydon site in the UK.', 22, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(530, 1, 'This brochure is produced using certified FSC® mixed sources material from well managed sources and is manufactured under a strict ISO 14001 environment system. 10% of this material is recovered fibre, diverting waste from landfill.', 33, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(531, 1, 'Working in luxury. Relaxing in luxury. A special place that you can call your own. The perfect combination of space, refinement and technology. Stretch out on the sumptuous semi-aniline leather of either of the two individually tailored rear seats. Offering recline, heating/cooling as well as four-way lumbar adjust, they can even treat you to a massage. The semi-aniline leather also extends to the front seats. Adding to the dramatic interior design is an electrically powered table. It rises gracefully from the centre console and can be rotated left or right as required. The rear section of the centre console also houses a 75cl bottle chiller which cools to the optimal drinking temperature. Two handcrafted champagne glasses come as standard with XJ Ultimate, complete with glass storage and holders positioned below the table.', 133, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(532, 1, 'LIVING IN LUXURY', 3, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(533, 1, 'Keep yourself in touch. Keep yourself entertained. Everywhere you look in XJ Ultimate you are presented with the most useful technology. XJ Ultimate features two 16Gb iPads integrated ', 28, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(534, 1, 'into the back of the front seats and which charge when the ignition is on. The iPads work ', 18, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(535, 1, 'independently of each other and can be removed from the docking stations ', 12, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(536, 1, 'for use outside ', 3, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(537, 1, 'the vehicle. For added convenience an iPad keyboard is fitted. Rear seat passengers can ', 14, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(538, 1, 'also enjoy their own independent use of the Rear Seat Entertainment System. Controlled ', 13, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(539, 1, 'through a compact Touch-screen unit that stows in the centre console when not in use, ', 15, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(540, 1, 'the WhiteFire® digital wireless system allows passengers to connect wireless headphones. ', 11, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
