(542, 1, 'YOU ARE IN CONTROL', 4, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(543, 1, 'An audio system designed and manufactured with the same attention to detail as a Jaguar. Designed and created specifically for XJ Ultimate’s unique interior space. Meridian is the ultimate audio specialist and creates sound just as the artist intended by benchmarking acoustic performance against real musical instruments. In fact, Meridian audio equipment is so advanced that, providing a microphone can detect  it, the system can always reproduce a sound. Meridian systems include unique technologies that provide superior audio performance by understanding the parameters that constitute a vehicle’s interior and turning them into an acoustic opportunity. Jaguar and Meridian audio specialists worked together using Meridian''s proprietary cabin correction technology to digitally correct low frequency distortion created by the cabin environment and deliver accurate, dynamic sound in all seating positions. Pioneered by Meridian, Trifield technology ensures a perfect stereo image for each occupant and produces a natural, enveloping sound within the cabin to deliver a concert-like experience.Standard on XJ Ultimate, the Meridian Surround audio system has every one of its 20 individual speakers strategically placed to optimise sound transmission. Powerful Digital Signal Processing (DSP) technology is applied to every speaker so that it performs with as much sound quality as a conventional speaker at least four times the size. The result is a more efficient audio system that uses less power to deliver more performance. With DSP every individual speaker has its own amplifier and converter to reproduce a more accurate performance of the source material. The Meridian Surround audio system offers the essence of technology and refinement. It delivers power, performance and quality; the absolute zenith of automotive audio excellence; the perfect complement to the  pinnacle of the Jaguar range, XJ Ultimate. ', 283, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
(544, 1, 'Intuitive technology that empowers, never overpowers. XJ Ultimate uses the latest technological innovations, including Adaptive Dynamics which achieves the optimum balance between ride and handling, to foster an exhilarating driving experience and to complement the driver’s skills. Building on Jaguar’s acknowledged interactive automotive expertise, information and key vehicle functions are easily accessible through the 8 inch Dual View Touch-screen. This displays audio, climate and navigation controls for the driver while allowing the front seat passenger to watch separate visual content of the same screen simultaneously. Bluetooth® connectivity on the move enables telephones with Bluetooth® capability to be connected to XJ Ultimate’s in-built telephone system.', 106, '2012-03-12 15:55:04', 7, 6, 5, 0, NULL, 0),
