(606, 1, 'XJ Ultimate’s Lightweight Vehicle Architecture is an aluminium monocoque body structure that is unique in the automotive industry and uses the state-of-the-art aerospace construction techniques of bonding and riveting. The result is a stronger, stiffer vehicle with better handling and increased refinement for occupants. The XJ Ultimate also uses Fusion Alloy Technology, magnesium, high-strength aluminium and one-piece door assemblies making it more than 150kg lighter than the next closest of its rivals. Less weight reduces ', 76, '2012-03-12 15:55:05', 7, 6, 5, 0, NULL, 0),
(607, 1, 'the mass that requires acceleration and results in better performance and fuel economy as well as lower ', 17, '2012-03-12 15:55:05', 7, 6, 5, 0, NULL, 0),
(608, 1, 'emissions. Coupled with XJ Ultimate’s almost perfect weight distribution of 51:49 between the front and rear, the car’s lightness delivers superb handling with remarkable agility through the bends. The result is a more driver-focused car. A car that is more satisfying to drive and in which to be a passenger. Recycled metal makes up as much as 50 percent of the body, saving approximately three tonnes of CO', 68, '2012-03-12 15:55:05', 7, 6, 5, 0, NULL, 0),
(609, 1, '2 ', 0, '2012-03-12 15:55:05', 7, 6, 5, 0, NULL, 0),
(610, 1, 'compared to using 100 percent primary aluminium. With aluminium capable of absorbing more energy per kilogramme than steel, XJ Ultimate’s construction not only delivers a body that is among the industry leaders for strength and stiffness, with benefits for ride, handling and maximising structural integrity, it also means that the XJ Ultimate will suffer less damage than a conventional steel car in an accident. The XJ Ultimate is designed to be strong. And designed to protect.', 76, '2012-03-12 15:55:05', 7, 6, 5, 0, NULL, 0),
