(1079, 1, 'XJ Ultimate’s Lightweight Vehicle Architecture is an aluminium monocoque body structure that is unique in the automotive industry and uses the state-of-the-art aerospace construction techniques of bonding and riveting. The result is a stronger, stiffer vehicle with better handling and increased refinement for occupants. The XJ Ultimate also uses Fusion Alloy Technology, magnesium, high-strength aluminium and one-piece door assemblies making it more than 150kg lighter than the next closest of its rivals. Less weight reduces the mass that requires acceleration and results in better performance and fuel economy as well as lower emissions.', 94, '2012-03-15 14:08:47', 7, 6, 5, 0, NULL, 0),
(1080, 1, 'Coupled with XJ Ultimate’s almost perfect weight distribution of 51:49 between the front and rear, the car’s lightness delivers superb handling with remarkable agility through the bends. The result is a more driver-focused car and an experience that is thrilling for driver and passenger alike. Recycled metal makes up as much as 50 percent of the body, saving approximately three tonnes of CO', 63, '2012-03-15 14:08:47', 7, 6, 5, 0, NULL, 0),
