(2390, 1, 'Jaguar Cars Limited is constantly seeking ways to improve the specification, design and production of its vehicles and alterations take place continually. Whilst every effort is made to produce up-to-date literature, this brochure should not be regarded as an infallible guide to current specifications, nor does it constitute an offer for the sale of any particular vehicle. Distributors and dealers are not agents of Jaguar Cars Limited by any express or implied undertaking or representation.', 75, '2012-06-21 18:01:18', 7, 6, 5, 0, NULL, 0),
(2391, 1, 'Jaguar is proud to continue the company’s', 8, '2012-06-21 18:01:18', 7, 6, 5, 0, NULL, 0),
(2392, 1, ' tradition with its approach to Environmental Innovation. From the choice of lightweight materials and lean production methods to the efficiency of its engines and designs, Jaguar is committed to operating as a more sustainable business and reducing its overall environmental impact.', 41, '2012-06-21 18:01:18', 7, 6, 5, 0, NULL, 0),
(2393, 1, 'Jaguar’s flagship XJ model was the first in the company to achieve ISO 14040, the international standard for vehicle ‘whole', 20, '2012-06-21 18:01:18', 7, 6, 5, 0, NULL, 0),
(2394, 1, ' life cycle’ assessment. This certification measures the environmental impact of XJ from component material sourcing and manufacturing process, through its driven life time, to final disposal. But that’s not all. Every new Jaguar vehicle is designed to be 85% recyclable and reusable, in addition to 95% recoverable and reusable with 10% for energy generation.', 52, '2012-06-21 18:01:18', 7, 6, 5, 0, NULL, 0),
(2395, 1, 'But it doesn’t stop there. World class manufacturing facilities certified to ISO 14001 since 1998, transport miles have been cut from delivery routes and new ways are being introduced to produce energy from food waste at our Gaydon site in the UK. That’s Environmental Innovation at Jaguar.', 47, '2012-06-21 18:01:18', 7, 6, 5, 0, NULL, 0),
