(2417, 1, 'It brings together sports car styling and performance, the refinement and features of a luxury saloon with the versatility of a spacious estate. XF Sportbrake introduces a new level of practicality to the dynamic performance that is at the heart of every Jaguar, presenting the spirit of the award-winning XF saloon in a new, more functional form. With its sleek extended roofline giving it an assertive silhouette, XF Sportbrake is unmistakably a sporting estate. Perfectly executed to carry more, its proportions have been shaped to achieve aerodynamic precision. ', 88, '2012-06-21 18:01:19', 7, 6, 5, 0, NULL, 0),
(2418, 1, 'The following pages provide details and specifications for the XF Sportbrake range. In-depth descriptions of key features and available options are designed to give you all the information you require to create the XF Sportbrake that’s just right for you. Please use this guide in conjunction  with the XF Sportbrake main brochure’s colour and trim sections for illustrations of colour and materials available.', 65, '2012-06-21 18:01:19', 7, 6, 5, 0, NULL, 0),
