(3011, 1, 'Uses microwave radar technology to monitor for slower moving traffic and can alert you to potential hazards ahead. It also controls both throttle and brakes to help maintain a constant time gap to the vehicle in front. When the road ahead clears, the system automatically accelerates back to the speed at which you were driving. Forward Alert provides an audible warning if traffic ahead slows.', 65, '2012-06-21 18:01:47', 7, 6, 5, 0, NULL, 0),
(3012, 1, 'INTELLIGENT STOP/START', 3, '2012-06-21 18:01:47', 7, 6, 5, 0, NULL, 0),
