(3014, 1, ' emissions. The engine will restart immediately as soon as the driver''s foot comes off the brake pedal. The engine will be operating at full capacity before the driver''s foot has touched the accelerator pedal.', 34, '2012-06-21 18:01:47', 7, 6, 5, 0, NULL, 0),
(3015, 1, 'PEDESTRIAN CONTACT SENSING SYSTEM™', 4, '2012-06-21 18:01:47', 7, 6, 5, 0, NULL, 0),
(3016, 1, 'Industry-leading system that senses an impact between a pedestrian and the front of the car. It instantaneously raises the bonnet through a small distance in a very controlled way, to help prevent the pedestrian from contacting hard points under the bonnet.', 41, '2012-06-21 18:01:47', 7, 6, 5, 0, NULL, 0),
(3017, 1, 'JAGUAR TYRE REPAIR SYSTEM', 4, '2012-06-21 18:01:47', 7, 6, 5, 0, NULL, 0),
(3018, 1, 'Provides an electric pump and a canister of sealant to enable a temporary repair and re-inflation for a puncture of up to 6mm diameter in the tread area of the tyre, but not in the tyre walls.', 37, '2012-06-21 18:01:47', 7, 6, 5, 0, NULL, 0),
(3019, 1, 'ADAPTIVE FRONT LIGHTING', 3, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3020, 1, 'Sensors react to the car’s speed and steering input, and the system can deflect headlamp beams casting light deeper into corners, giving added confidence at night. Intelligent high beam automatically maximises driver visibility. When sensing preceding, oncoming traffic or street lights, the headlamps will automatically switch to low beam.', 50, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3021, 1, 'BLIND SPOT MONITOR', 3, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3022, 1, 'Uses radar sensors to remotely cover areas that cannot be seen either directly or by mirror, and alerts the driver of overtaking traffic with an amber warning icon in the external mirrors.', 32, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3023, 1, 'INTELLIGENT HIGH BEAM', 3, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3024, 1, 'When sensing preceding, oncoming traffic or street lights, the headlamps will automatically switch to low beam, maximising driver visibility and appropriate beam useage. The system automatically switches to high beam when the oncoming car has passed.', 36, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3025, 1, 'JAGUAR SENSE™', 2, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3026, 1, 'An electronic control system that operates the front overhead console lights and opening of the glovebox by a light touch.', 20, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3027, 1, 'JAGUAR SMART KEY SYSTEM™ WITH KEYLESS START AND KEYLESS ENTRY', 10, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3028, 1, 'With the Jaguar Smart Key in your pocket or bag, the car automatically unlocks as you pull the door handle. Simply push the ignition button to start the engine. Upon leaving, press a button on the door handle to lock the car or use the Jaguar Smart Key.', 48, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3029, 1, 'DUAL ZONE CLIMATE CONTROL', 4, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3030, 1, 'With humidity control, air filtration and dual temperature control for driver and front passenger.', 14, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3031, 1, 'AUTO RECIRCULATION – CLIMATE CONTROL', 4, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3032, 1, 'Automatic cabin air recirculation triggered by external odour sensor with 5 sensitivity settings.', 12, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3033, 1, 'NAVIGATION SYSTEM WITH HDD MAPPING', 5, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3034, 1, ', FRONT DVD AND VIRTUAL MULTI-CHANGER', 5, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3035, 1, 'HDD based system, providing faster access to data including postcode entry, destination entry on the move, voice guidance, voice control input, RDS and TMC (Traffic Messaging Channel)/Dynamic Route Guidance, accessed through Touch-screen control system. The navigation system also includes a front DVD capable of playing video and audio. File formats include Windows Media Audio (WMA), ACC and MP3. In addition there is a virtual multi-changer that uses the hard disc drive (HDD) for storage of up to 10 CDs of uncompressed music.', 82, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3036, 1, 'WINDOWS MEDIA AUDIO (WMA) AND MP3 COMPATIBILITY', 7, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3037, 1, 'Enables the CD player to plays CDs which contain WMA and MP3 files.', 13, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3038, 1, 'INTERACTIVE VOICE', 2, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3039, 1, 'Uses "Say What You See" technology to guide the user to the correct commands for voice control of audio, Bluetooth® audio streaming and navigation. When in operation, as well as audio prompts, all commands appear on the Touch-screen.', 38, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3040, 1, 'FRONT MEDIA INTERFACE', 3, '2012-06-21 18:01:48', 7, 6, 5, 0, NULL, 0),
(3041, 1, 'Allows the connection of an iPod, MP3 player or a USB Mass Storage Device to the in-car sound system and control via the 7 inch colour Touch-screen.', 26, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3042, 1, '7 INCH COLOUR TOUCH-SCREEN', 3, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3043, 1, 'With controls for audio, climate control, Bluetooth® audio streaming (where fitted) and Navigation (where fitted).', 15, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3044, 1, 'BLUETOOTH® AUDIO STREAMING', 3, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3045, 1, 'A Bluetooth® equipped Jaguar, enables hands free use of your mobile phone at any time when the phone is in the car through the Touch-screen. Bluetooth® also provides the ability to stream audio content, and full function control enables easy track selection. Bluetooth® is compatible with many mobile phones from most manufacturers including Apple, BlackBerry® and HTC ', 57, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3046, 1, ' ask your local Jaguar dealer or visit jaguar.com for more details.', 12, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3047, 1, 'MULTIMEDIA (CONTINUED)', 2, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3048, 1, 'JAGUAR AUDIO SYSTEM (250W)', 4, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3049, 1, '250W sound system with AM/FM radio featuring EON, RDS, PTY, TA and single slot CD with MP3 compatibility and 10 speakers.', 21, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3050, 1, 'MERIDIAN AUDIO SYSTEM (380W)', 4, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3051, 1, 'Powered by a dedicated 12-channel amplifier featuring Audyssey MultEQ audio equalisation and dynamic volume control. This amplifer powers 11 speakers, MP3 compatibility, single slot CD and auxiliary input.', 27, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3052, 1, 'MERIDIAN SURROUND AUDIO SYSTEM (825W)', 5, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3053, 1, 'Includes 15 amplifier channels and 12 speakers featuring Audyssey MultEQ sound equalisation and dynamic volume control. Includes Meridian Trifield™ Surround Mode.', 19, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3054, 1, 'TRAFFIC MESSAGE CHANNEL (TMC)', 4, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3055, 1, 'An application of the FM Radio Data System (RDS) used for broadcasting real-time traffic and weather information. Data messages are received and decoded by a TMC-equipped car radio or navigation system, and delivered to the driver in a variety of ways. The most common of these is a TMC-enabled navigation system that can offer dynamic route guidance, alerting the driver of a problem on the planned route and calculating an alternative route to avoid the incident.', 76, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3056, 1, 'Alloy space saver required when 20" wheels specified.', 7, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3057, 1, 'The Navigation system must always be used in conditions that will not affect the driver''s ability to drive safely or affect the safety of other road users.', 27, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3058, 1, 'Different DVDs exist in different regions. Please consult your local Jaguar dealer for details of which countries are covered by the DVD supplied with your vehicle.', 26, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3059, 1, '‘Trifield’ and the ‘three fields’ device are trademarks of Trifield Productions Ltd.', 12, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3060, 1, 'OWNERSHIP EXPERIENCE', 2, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3061, 1, 'Enabling you to personalise your car, to create a driving experience that is even more individually rewarding. All Jaguar accessories are tested rigorously for safety and durability in the most arduous of climates and conditions. A comprehensive range of styling options, interior and exterior accessories, enabling you to tailor your XF Sportbrake to suit your personal style. The full range of Jaguar accessories is available to view on-line, please visit jaguar.com for further information. ', 75, '2012-06-21 18:01:49', 7, 6, 5, 0, NULL, 0),
(3062, 1, 'Any genuine Jaguar Accessories (excluding gift items and luggage from Jaguar Collection) supplied and fitted by a Jaguar dealer within one month or 1,500km/1,000 miles (whichever occurs first) of a new vehicle being put into service will benefit from the same warranty terms and duration as the Vehicle Warranty. Accessories purchased outside of this period will be subject to 12 month unlimited mileage warranty.', 63, '2012-06-21 18:01:50', 7, 6, 5, 0, NULL, 0),
(3063, 1, 'An official Jaguar dealer or Approved Service Centre can ensure that Jaguar trained, specialist technicians, with access to the full range of Jaguar approved parts and tools, will always be on hand to guarantee that every fitting, or repair, is carried out exactly the way Jaguar intended. Your Jaguar dealer or Approved Service Centre can also supply and fit Jaguar approved accessories to personalise and add to the practicality and style of your XF Sportbrake model.', 76, '2012-06-21 18:01:50', 7, 6, 5, 0, NULL, 0),
(3064, 1, 'SERVICE AND ASSURANCE', 3, '2012-06-21 18:01:50', 7, 6, 5, 0, NULL, 0),
(3065, 1, 'Complete peace of mind including Competitively Priced Servicing, Seasonal Health Checks and Total Tyre Care to ensure that your Jaguar XF Sportbrake retains its premium condition, delivering optimal performance.', 29, '2012-06-21 18:01:50', 7, 6, 5, 0, NULL, 0),
(3066, 1, '†All Jaguar Approved Accessories are rigourously tested to the same exacting standards as those applied to our vehicles. Performance in extreme hot and cold temperatures, corrosion resistance, impact and airbag deployment highlight some of the exhaustive product testing carried out so that Accessories are both durable and importantly, continue to comply with current legalisation.', 54, '2012-06-21 18:01:50', 7, 6, 5, 0, NULL, 0),
(3067, 1, 'Service, assurance, and peace of mind are all part of the pride of owning your XF Sportbrake.', 17, '2012-06-21 18:01:50', 7, 6, 5, 0, NULL, 0),
(3068, 1, 'MULTIMEDIA (TESTING)', 2, '2012-06-21 18:02:33', 7, 1, 5, 0, NULL, 0),
