INSERT INTO `instructions` (`uID`, `sourceLangID`, `content`) VALUES
(1, 1, '***********************************\r\n\r\nPlease open this project in Microsoft Word. If you have opened in another program, please close without saving and open again in Microsoft word.\r\n\r\nYou will see the same text appear twice, one on top of the other. Please edit the text highlighted in grey, using the text directly above it for a reference.\r\n\r\n•	Please only open and edit this file in Microsoft Word.\r\n•	Do not edit the original text at the top line as this will affect the importing.\r\n•	Please only edit the grey highlighted text.\r\n•	Do not remove any hidden characters/formatting.\r\n•	Do not attempt to down save to a doc file.\r\n\r\nOnce you have completed the document save the document either by using CTRL + S or File > Save. Then exit the application.\r\n\r\n***********************************'),
(2, 8, '***********************************\r\n\r\n请务必使用Microsoft Word打开文件。如果你已经使用了其他程序，请不要保存，立刻退出程序。每条翻译记录都会有两行。请参照第一行的原文来编辑灰底色的一行\r\n\r\n•	请只在Microsoft Word打开和编辑该文件。\r\n请不要修改第一行因为这样会影响文件导入。\r\n•	请仅仅编辑灰底色的一行。\r\n•	请不要删除任何的隐藏文字和格式。\r\n•	请不要将该文件另存为doc文件。\r\n\r\n当您完成后请保存并退出，不要另存为其他文件格式。\r\n\r\n***********************************'),
(3, 3, '***********************************\r\n\r\nBitte öffnen Sie dieses Projekt in Microsoft Word. Wenn Sie in einem anderen Programm geöffnet haben, schließen Sie bitte ohne zu speichern und wieder öffnen in Microsoft Word.\r\n\r\nSie werden sehen, den gleichen Text erscheint zweimal, einer über dem anderen. Bitte bearbeiten Sie den Text in grau hervorgehoben, mit dem Text direkt über ihr für einen Verweis.\r\n\r\n•	Bitte nur öffnen und bearbeiten Sie diese Datei in MS Word.\r\n•	Bearbeiten Sie nicht den ursprünglichen Text in der oberen Zeile wie diese dem einführenden beeinflussen.\r\n•	Bitte nur bearbeiten, die grau markierten Text.\r\n•	Entfernen Sie keine versteckten Zeichen / Formatierung.\r\n•	Versuchen Sie nicht, bis auf eine doc-Datei speichern.\r\n\r\nNach Abschluss des Dokuments speichern Sie das Dokument entweder über STRG + S oder Datei> Speichern. Dann die Anwendung beenden.\r\n\r\n***********************************');
