(1055, 1, 'Cruise Control with Automatic Speed Limiter (ASL)', 7, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1056, 1, 'Navigation system with HDD mapping', 5, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1057, 1, 'Exclusive ''Ultimate'' sculpted lower air intake finishers, chrome plated finish to match grille', 13, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1058, 1, '''Ultimate'' Intaglio - high gloss diamond cut', 7, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1059, 1, 'Seat back iPad dock - ''tailored'' leather surround with opening door and charging capability. iPad integrated to 825 watt Meridian Surround Sound System', 22, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1060, 1, '– Powered passenger table - machined from solid aluminium with high gloss Piano Black finish and chrome detail to edge', 19, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1061, 1, '– Rear Media Interface - USB and RCA connectors', 8, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1062, 1, 'Two individual, hand built ''tailored'' rear seats in semi-analine premium natural leather, with recline, massage and four-way lumbar adjust', 19, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1063, 1, 'Handcrafted Herringbone veneer - exclusive to XJ Ultimate', 8, '2012-03-15 14:08:45', 7, 6, 5, 0, NULL, 0),
(1064, 1, 'The Bluetooth® word mark and logos are owned by the Bluetooth SIG, Inc. and any use of such marks by iPod, iPod touch and iPad are trademarks of Apple Inc., registered in the U.S. and other countries.', 38, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1065, 1, '™ ', 0, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1066, 1, 'is a registered trademark of DTS Inc. and any use of such marks by Jaguar Cars Limited is under license.', 20, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1067, 1, 'Printed in England JLM/24/85/04/0412', 4, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1068, 1, 'The XJ and XK’s innovative use of lightweight aluminium, which incorporates up to 50% recycled material from the manufacturing process of the body structures, provides considerable performance benefits. This includes improved fuel consumption, and less CO', 36, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1069, 1, 'LIVINGIN LUXURY', 2, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1070, 1, 'Keep yourself in touch. Keep yourself entertained. Everywhere you look in XJ Ultimate you are presented with the most useful technology. XJ Ultimate features two 16Gb iPads integrated into the back of the front seats and which charge when the ignition is on. The iPads work independently of each other and can be removed from the docking stations for use outside the vehicle. For added convenience an iPad keyboard is fitted. Rear seat passengers can also enjoy their own independent use of the Rear Seat Entertainment System. Controlled through a compact Touch-screen unit that stows in the centre console when not in use, the WhiteFire® digital wireless system allows passengers to connect wireless headphones. Additional passenger wellbeing is provided by the climate settings controls in centre console.', 127, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1071, 1, 'Pioneered by Meridian, Trifield technology ensures a perfect stereo image for each occupant and produces a natural, enveloping sound within the cabin to deliver a concert-like experience. The Meridian Surround audio system offers the essence of technology and refinement. It delivers power, performance and quality; the perfect complement to the pinnacle of the Jaguar range, XJ Ultimate.', 57, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1072, 1, 'Standard on XJ Ultimate, the Meridian Surround audio system has every one of its 20 individual speakers strategically placed to optimise sound transmission. Powerful Digital Signal Processing (DSP) technology is applied to every speaker so that it performs with as much sound quality as a conventional speaker at least four times the size. The result is a more efficient audio system that uses less power to deliver more performance.', 68, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1073, 1, 'An audio system designed and manufactured with the same attention to detail as a Jaguar; Meridian is the ultimate audio specialist and creates sound just as the artist intended by benchmarking acoustic performance against real musical instruments. In fact, Meridian audio equipment is so advanced that, providing a microphone can detect it, the system can always reproduce a sound.', 59, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1074, 1, 'Three colourways are available with a choice of a Bordeaux upper facia with Ivory seat trim, Jet upper facia with Jet seat trim or Mineral upper facia with Ivory seat trim. The Jet colourway is complemented by a choice of Ivory or Jet headlining, and the Mineral/Ivory and Bordeaux/Ivory colourways come with an Ivory headlining as standard. While a unique Herringbone veneer is standard on XJ Ultimate, a total choice of twelve highest-quality finishes are available.', 78, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
(1075, 1, 'Gloss Figured Ebony with Ribbon Laser Inlay', 7, '2012-03-15 14:08:46', 7, 6, 5, 0, NULL, 0),
