(1380, 1, 'TEST Economy INSERT INTO `paragraphs` (`uID`, `LangID`, `ParaText`, `Words`, `timeRef`, `user_id`, `type_id`, `brand_id`, `subject_id`, `notes`, `rating`) VALUES
(1857, 1, '(Wed, 20 May 2009 07:25:03)', 2, '2012-06-12 12:12:36', 7, 6, 5, 0, NULL, 0),
(1858, 1, '"Experiential"', 1, '2012-06-12 12:12:36', 7, 6, 5, 0, NULL, 0),
(1859, 1, '75th Anniversary Drive', 3, '2012-06-12 12:12:36', 7, 6, 5, 0, NULL, 0),
(1860, 1, '00 Jaguar in Frankfurt 2011', 3, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1861, 1, 'Jaguar in Frankfurt', 3, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1862, 1, 'LIVE FROM THE FRANKFURT MOTOR SHOW', 6, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1863, 1, 'Jaguar to reveal latest sports car concept, the C-X16 at this year’s Frankfurt Motor Show >', 16, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1864, 1, 'This year’s Frankfurt Motor Show will be the first public appearance of Jaguar’s exciting new sports car concept, the C-X16.', 22, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1865, 1, 'Jaguar''s two-seat concept is a new breed of Jaguar sports car that aims to set a new class benchmark for design, vehicle dynamics and technology.', 25, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1866, 1, 'As one of the world’s largest motor shows, Frankfurt has seen the launch of many of the world’s most exciting cars. The C-X16 will be no exception and will be on view throughout this year’s show, which is open to the public from 13th September – 25th September, 2011.', 50, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1867, 1, 'If you’re lucky enough to be in Frankfurt at the time, you can find Jaguar in Hall 5, Stand B22.', 20, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1868, 1, 'As well as the live reveal, our Facebook page will have lots of exciting news, exclusive behind the scenes images and reaction to the car from Jaguar enthusiasts all over the world. If you are at this year’s event, please feel free to share some of your images with us.', 51, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1869, 1, 'Join Jaguar on Facebook >', 4, '2012-06-12 12:13:23', 7, 6, 5, 0, NULL, 0),
(1870, 1, '030 XF Config Item Type', 4, '2012-06-12 12:15:15', 7, 6, 5, 0, NULL, 0),
(1871, 1, 'CONFIGURE YOUR XF', 3, '2012-06-12 12:15:15', 7, 6, 5, 0, NULL, 0),
(1872, 1, 'Create your own XF >', 4, '2012-06-12 12:15:15', 7, 6, 5, 0, NULL, 0),
(1873, 1, '/_$link-ref:''2730636''_', 3, '2012-06-12 12:15:15', 7, 6, 5, 0, NULL, 0),
(1874, 1, '019 F-TYPE Press Release', 3, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1875, 1, 'JAGUAR ANNOUNCES ALL-NEW SPORTS CAR: THE JAGUAR F-TYPE', 8, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1876, 1, 'Today at the New York International Auto Show, Jaguar formally announced that an all-new sports car will enter production; the Jaguar F-TYPE.', 22, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1877, 1, 'NEW YORK (April 4, 2012) – Today at the New York International Auto Show, Jaguar formally announced that an all-new sports car will enter production; the Jaguar F-TYPE.  A true two-seat sports car, the Jaguar', 32, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1878, 1, 'F-TYPE will launch as a convertible becoming the fourth model in the current line of innovative and seductive cars, along with the XF sports sedan, the XJ luxury sedan and the XK coupe/convertible.', 34, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1879, 1, 'Benefitting from Jaguar''s leading expertise in aluminum vehicle construction, the Jaguar F-TYPE will focus uncompromisingly on delivering a rewarding drive experience.  A range of engines will be available, including a new powerplant family.  All will deliver stunning sports car performance.', 40, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1880, 1, 'Speaking at the New York auto show Adrian Hallmark, Global Brand Director, Jaguar Cars, confirmed: "We showed the C-X16 concept in September 2011, and the reaction to it has been so positive that we''ve accelerated our development of an all-new Jaguar sports car. That car will be called the Jaguar F-TYPE, and it will be unveiled in production form later this year. The core appeal of Jaguar''s cars is their sporting heart, and that heart will beat stronger than ever before in the F-TYPE. Its development is a vivid representation of the confidence and ambition of the Jaguar brand, and the desire amongst our engineers and design team to produce a world-leader in a market segment that we have been absent from for too long. But no longer, the F-TYPE is coming."', 131, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1881, 1, 'This day also marks the point at which the rigorous development program for the Jaguar F-TYPE moves into the final road testing phase. Engineering prototypes are now being placed into service at Jaguar''s Castle Bromwich plant in the British Midlands. This is the same plant at which will build the production car.', 52, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1882, 1, 'Ian Hoban, Jaguar''s Vehicle Line Director said: "The engineering development of the F-TYPE has focused on delivering a heightened level of dynamic driving reward. We are excited about our progress to date and are looking forward to soon being able to demonstrate what we have achieved."', 46, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1883, 1, 'Ian Callum, Director of Design, said: "A true sports car needs to be pure in both its purpose and its form; to have the opportunity to produce such a car for Jaguar has been a privilege both for myself and for my team. The C-type, D-type and E-type Jaguars were all sports cars that held true to this principle in their era, and the F-TYPE will hold true to that same principle in its time, a time that is soon to arrive."', 82, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1884, 1, 'Full Jaguar F-TYPE technical and model range details will be announced later in 2012.  It will go on sale in mid-2013.', 20, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
(1885, 1, 'F-TYPE KMI Site', 3, '2012-06-12 12:15:32', 7, 6, 5, 0, NULL, 0),
