(1946, 24, 'Press Release 019 F-TYPE', 3, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1947, 24, 'JAGUAR ANUNCIA ALL-novo carro esportivo: O Jaguar F-Type', 8, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1948, 24, 'Hoje, no New York Internacional Auto Show, a Jaguar anunciou formalmente que um novo carro esporte vai entrar em produção, o Jaguar F-Type.', 24, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1949, 24, 'NOVA YORK (4 de abril de 2012) - Hoje, no New York Internacional Auto Show, a Jaguar anunciou formalmente que um novo carro esporte vai entrar em produção, o Jaguar F-Type. Um verdadeiro dois-assento de carro esportivo, o Jaguar', 38, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1950, 24, 'F-TYPE lançará como um conversível tornando-se o quarto modelo da linha atual de carros inovadores e sedutor, junto com o sedã esportivo XF, o sedã de luxo XJ eo cupê XK / conversível.', 35, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1951, 24, 'F-TYPE lançará como um conversível tornando-se o quarto modelo da linha atual de carros inovadores e sedutor, junto com o sedã esportivo XF, o sedã de luxo XJ eo cupê XK / convertible.Benefitting da perícia levando Jaguar na construção de veículos de alumínio, o Jaguar F-Type incidirá intransigente em entregar uma experiência de unidade gratificante. A gama de motores estará disponível, incluindo um novo motor da família. Tudo vai proporcionar um desempenho impressionante carro esporte.', 84, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1952, 24, 'Falando no New York Auto Show Adrian Hallmark, diretor de Marca Global da Jaguar Cars, confirmou: "Nós mostramos o conceito C-X16 em setembro de 2011, ea reação a ele tem sido tão positiva que nós aceleramos nosso desenvolvimento de um todo -nova Jaguar carro esporte. esse carro vai ser chamado de Jaguar F-Type, e ele será revelado em forma de produção ainda este ano. o apelo do núcleo dos carros da Jaguar é o seu coração desportivo, e que o coração vai bater mais forte do que nunca na o F-TYPE. o seu desenvolvimento é uma representação viva da confiança e ambição da marca Jaguar, eo desejo entre os nossos engenheiros e equipe de design para produzir um líder mundial em um segmento de mercado que estiveram ausentes por muito tempo. mas não, o F-TYPE está chegando. "', 147, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1953, 24, 'Este dia também marca o ponto em que o programa de desenvolvimento rigoroso para os F-TIPO Jaguar move-se na fase final estrada teste. Protótipos de engenharia estão agora a ser colocado em serviço na fábrica da Jaguar em Castle Bromwich Midlands britânicos. Esta é a mesma planta em que vai construir o carro de produção.', 61, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1954, 24, 'Ian Hoban, Director da Jaguar da Linha de Veículos, disse: "O desenvolvimento de engenharia da F-TYPE foi focada em fornecer um alto nível de recompensa de condução dinâmica Estamos entusiasmados com o nosso progresso até à data e esperamos em breve ser capaz de demonstrar que nós. tem alcançado. "', 54, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1955, 24, 'Ian Callum, Director de Design, disse: "Um verdadeiro carro esporte precisa ser puro tanto na sua finalidade e sua forma, ter a oportunidade de produzir um carro para a Jaguar foi um privilégio tanto para mim e para minha equipe. tipo C, D e e do tipo tipo Jaguars eram todos os carros esportivos que era verdade a este princípio em sua época, eo F-TYPE manterá fiel a esse mesmo princípio em seu tempo, uma vez que está prestes a chegar. "', 84, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
(1956, 24, 'Completo Jaguar F-TYPE detalhes alcance técnicas e modelo serão anunciados mais tarde, em 2012. Ele estará à venda em meados de 2013.', 21, '2012-06-12 14:56:34', 7, 5, 5, 0, NULL, 0),
