(3273, 1, 'The continuous shooting and compositing capabilities of the Back-illuminated CMOS image sensor help you take beautiful Night landscape or Night portrait pictures while shooting with the camera in hand.', 29, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3274, 1, 'High-speed continuous shooting helps capture all the action', 8, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3275, 1, 'The COOLPIX P510 keeps you ahead of the action with high-speed shooting options. High-speed continuous shooting enables rapid capturing at 5-fps (approx.) for full-resolution (4608 x 3456) images*. Other high-speed modes include Sports continuous mode (approx. 60fps/120fps) and the Pre-shooting cache.', 40, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3276, 1, 'Optimized controls and designed for efficient handling', 7, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3277, 1, 'The 7.5-cm (3-in.) vari-angle 921k-dot (approx.) high-resolution Clear color display can be tilted as much as 90 degrees (approx.) upward or 82 degrees (approx.) downward. You can assign often-used functions to the new Function button for quick one-touch access. The handgrip is designed to help minimize camera shake. And the body includes a side zoom control for stable handling.', 57, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3278, 1, '*Up to five consecutive images.', 5, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3279, 1, '42x optical zoom and highly advanced VR image stabilization', 9, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3280, 1, 'A 16.1 megapixel Back-illuminated CMOS image sensor is paired with a 42x zoom ', 12, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3281, 1, 'NIKKOR ED glass lens that covers the phenomenal focal range of 24 mm wide-angle ', 13, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3282, 1, 'to 1000 mm super-telephoto*. Newly advanced Lens-shift VR image stabilization ', 9, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3283, 1, 'compensates more effectively than ever** for camera shake. This serves as a big aid in', 15, '2012-07-11 15:38:58', 7, 6, 1, 0, NULL, 0),
(3284, 1, 'achieving consistently sharp results, particularly when taking advantage of the super-zoom or shooting macros.', 14, '2012-07-11 15:38:59', 7, 6, 1, 0, NULL, 0),
