(3286, 1, 'Back-illuminated CMOS image sensor helps realize high image quality', 9, '2012-07-11 15:38:59', 7, 6, 1, 0, NULL, 0),
(3287, 1, '16.1 effective megapixels of pure imaging power yields the high-resolution images you desire. The combined continuous shooting capabilities of this Back-illuminated CMOS image sensor optimize performance when shooting at night to deliver beautiful results and reproduce even the fine details.', 39, '2012-07-11 15:38:59', 7, 6, 1, 0, NULL, 0),
(3288, 1, ' White', 1, '2012-07-11 15:38:59', 7, 6, 1, 0, NULL, 0),
