(3290, 1, '•	7.5-cm (3-in.) high-resolution 921k-dot (approx.) Clear color display', 8, '2012-07-11 15:38:59', 7, 6, 1, 0, NULL, 0),
(3291, 1, '•	Silhouette and High ISO monochrome newly added to the lineup of Special effects available when shooting pictures or movies', 19, '2012-07-11 15:38:59', 7, 6, 1, 0, NULL, 0),
(3292, 1, '•	Full 1080p HD movie recording with stereo sound', 8, '2012-07-11 15:38:59', 7, 6, 1, 0, NULL, 0),
(3293, 1, 'The dedicated Mode dial provides easy access to the P/S/A/M exposure modes, while its User setting mode labeled “U” lets you save your favorite settings for use at any time. Often-used functions can be assigned to the new Function button on the face of the camera for quick access. And, there’s an independent Command dial that provides finer creative control over settings while shooting, as well as convenient functions during playback and menu operation. In addition, COOLPIX Picture Control lets you select a profile defining sharpness, saturation, color adjustment and other settings before shooting that help achieve the ideal result.', 104, '2012-07-11 15:39:00', 7, 6, 1, 0, NULL, 0),
(3294, 1, 'Manual and custom settings for creating your envisioned image', 9, '2012-07-11 15:39:00', 7, 6, 1, 0, NULL, 0),
(3295, 1, 'Bright f/1.8, 24mm wide-angle lens and highly advanced VR image stabilization', 11, '2012-07-11 15:39:00', 7, 6, 1, 0, NULL, 0),
(3296, 1, 'A specially crafted f/1.8 zoom NIKKOR lens, which includes the use of High refractive index glass elements, yields sharp images with high contrast. Its design also helps achieve a highly compact form factor. The lens’ fast aperture, 4.2x optical zoom and 24 mm wide-angle coverage* expand creative possibilities, particularly when shooting indoors or at night. Newly advanced Lens-shift VR image stabilization helps consistently sharp results by realizing the equivalent of using a faster shutter speed setting to effectively compensate for camera shake.', 81, '2012-07-11 15:39:00', 7, 6, 1, 0, NULL, 0),
