(3315, 1, 'Record full 1080p HD movies with stereo sound at the press of a button. You can set the camera to apply Special effects and operate the 18x optical zoom while recording to better realize your vision for the scene. Create highlight digest movies* with the Movie editing function. And a built-in HDMI mini connector enables output to your HDTV.**', 59, '2012-07-11 15:39:01', 7, 6, 1, 0, NULL, 0),
