(3321, 1, 'A high-performance GPS chip records location data for each shot, and can also log your movements, even when not taking pictures. An onboard database of approximately 1.7 million POI (Points of Interest) lets you confirm and record the name of the location when shooting. There is also an Electronic compass function that displays the camera’s orientation when shooting and records the location for later viewing on your personal computer.', 69, '2012-07-11 15:39:02', 7, 6, 1, 0, NULL, 0),
