(3445, 1, 'The 16.1 effective-megapixel CCD image sensor yields high-resolution images that reproduce even fine details, and leave plenty of leeway for creative cropping. Nikon’s EXPEED C2 image processing engine renders those pictures quickly and faithfully, while ensuring that all onboard systems run with optimum speed and efficiency.', 46, '2012-07-11 15:39:12', 7, 6, 1, 0, NULL, 0),
