(3448, 1, 'Easy auto mode lets you simply turn on the camera and start shooting, while the camera automatically selects the appropriate scene mode from among Portrait, Night portrait, Night landscape, Landscape, Backlighting and Close-up.', 33, '2012-07-11 15:39:12', 7, 6, 1, 0, NULL, 0),
