(3485, 1, 'A 7.5-cm (3-in.) vari-angle 921k-dot high-resolution Clear color display tilts to enable more flexible shooting in a wide range of applications. Front and rear command dials offer control over settings without removing your hands from the grip.', 37, '2012-07-11 15:39:16', 7, 6, 1, 0, NULL, 0),
(3486, 1, 'GPS geotagging and World map display', 6, '2012-07-11 15:39:16', 7, 6, 1, 0, NULL, 0),
(3487, 1, 'A high-performance GPS chip records location data for each shot and can be set to log your movements, even when not taking pictures. Pictures and routes can then be viewed using the new Built-in world map display. It adds a new dimension of photographic pleasure, from tracking your progress on a golf course, to marking the location of that great catch. There is also an Electronic compass function that records the camera’s orientation when shooting.', 76, '2012-07-11 15:39:16', 7, 6, 1, 0, NULL, 0),
(3488, 1, 'Built to capture the moment most anywhere you go', 9, '2012-07-11 15:39:16', 7, 6, 1, 0, NULL, 0),
(3489, 1, 'Built to withstand depths of up to 10 m, temperatures down to -10°C, and shock from heights of up to 1.5 m, the COOLPIX AW100 is the slim compact camera made to go more of the places you like to explore. Action control enables one-handed control over assigned functions, whether wearing ski gloves or skin-diving gloves. Underwater mode offers automated assistance in capturing beautiful underwater pictures.', 65, '2012-07-11 15:39:16', 7, 6, 1, 0, NULL, 0),
(3490, 1, 'Special effects enable greater artistic expression', 6, '2012-07-11 15:39:16', 7, 6, 1, 0, NULL, 0),
(3491, 1, 'Enhance your images while shooting with a variety of easy-to-set effects. Choose from the ‘Zoom exposure’ and ‘Defocus during exposure’ mechanical processes, or Special effects modes that include Soft, Nostalgic sepia, High-contrast monochrome, High key, Low key, Selective color, Creative monochrome, and Painting. In-camera Filter effects let you apply similar enhancements to shots already taken.', 55, '2012-07-11 15:39:16', 7, 6, 1, 0, NULL, 0),
