(4251, 1, 'De XK beschikt over een ', 5, '2012-07-17 21:19:24', 7, 6, 1, 0, NULL, 0),
(4252, 1, ' geavanceerde veiligheidssystemen die het risico van een ongeval moet beperken en de inzittenden en andere weggebruikers dient te beschermen.', 19, '2012-07-17 21:19:24', 7, 6, 1, 0, NULL, 0),
(4253, 1, 'De veiligheidssystemen van de XK zijn ontworpen om het gevaar voor een ongeval te beperken en zowel de inzittenden als andere weggebruikers te beschermen als een aanrijding niet kan worden vermeden.', 31, '2012-07-17 21:19:24', 7, 6, 1, 0, NULL, 0),
(4254, 1, 'Het toonaangevende Pedestrian Contact Sensing System™ en het automatische activeringssysteem van de motorkap kunnen ook mensen buiten de auto beschermen. Het systeem is ontwikkeld om de motorkap over een kleine afstand omhoog te brengen wanneer het contact met een voetganger detecteert. Zo voorkomt het dat het hoofd van de voetganger in aanraking komt met harde delen onder de motorkap.', 59, '2012-07-17 21:19:24', 7, 6, 1, 0, NULL, 0),
(4255, 1, 'Koprolbescherming voor Convertible-modellen', 3, '2012-07-17 21:19:24', 7, 6, 1, 0, NULL, 0),
(4256, 1, 'De XK Convertible heeft zijn eigen specifieke veiligheidsuitrusting met onder meer een uiterst ', 13, '2012-07-17 21:19:24', 7, 6, 1, 0, NULL, 0),
(4257, 1, 'geavanceerde koprolbescherming. Wanneer de boordsensoren van de auto een dreigende koprol detecteren, worden in 65 milliseconden twee supersterke beugels, die normaal verborgen zitten onder de kapafdekking, geactiveerd en achter de achterbank vergrendeld.', 31, '2012-07-17 21:19:24', 7, 6, 1, 0, NULL, 0),
(4258, 1, 'De XK is voorzien van een aantal veiligheidssystemen om de koersvastheid en de stabiliteit te verbeteren:', 16, '2012-07-17 21:19:25', 7, 6, 1, 0, NULL, 0),
(4259, 1, '- Elektronische remkrachtverdeler (EBD)', 3, '2012-07-17 21:19:25', 7, 6, 1, 0, NULL, 0),
(4260, 1, '- Antiblokkeerremsysteem (ABS)', 2, '2012-07-17 21:19:25', 7, 6, 1, 0, NULL, 0),
(4261, 1, '- Traction Control (via de motor en remmen)', 7, '2012-07-17 21:19:25', 7, 6, 1, 0, NULL, 0),
(4262, 1, ' “Nos gusta todo del XF: tiene una apariencia fantástica, se conduce de una forma brillante y consigue también un sentido financiero real” ', 24, '2012-07-17 21:19:25', 7, 6, 1, 0, NULL, 0),
(4263, 1, 'De XK beschikt over een reeks geavanceerde veiligheidssystemen die het risico van een ongeval moet beperken en de inzittenden en andere weggebruikers dient te beschermen.', 25, '2012-07-17 21:22:09', 7, 6, 1, 0, NULL, 0),
(4264, 1, '030 Features', 1, '2012-07-17 21:23:00', 7, 6, 1, 0, NULL, 0),
(4265, 1, 'XK eigenschappen', 2, '2012-07-17 21:23:00', 7, 6, 1, 0, NULL, 0),
(4266, 1, 'Twee in een: de XK is zowel een luxueuze GT als een opwindende, dynamische sportauto.', 15, '2012-07-17 21:23:00', 7, 6, 1, 0, NULL, 0),
(4267, 1, 'De XK is meer dan een machine - het is een combinatie van de bekende stijl en luxe van Jaguar. Een schitterende Grand Tourer met alle veelzijdigheid van een 2 + 2 zitplaatsconfiguratie. Het met de hand vervaardigde interieur biedt u totaal comfort, hoe ver u ook moet reizen.  Deze auto biedt een ', 50, '2012-07-17 21:23:00', 7, 6, 1, 0, NULL, 0),
(4268, 1, 'onvergetelijke rijervaring, dankzij de combinatie van een gespierde carrosserievormgeving, de krachtige motoren en een uitzonderlijke wegligging, ', 16, '2012-07-17 21:23:00', 7, 6, 1, 0, NULL, 0),
(4269, 1, 'wat', 1, '2012-07-17 21:23:00', 7, 6, 1, 0, NULL, 0),
(4270, 1, ' uw bestemming ook is.', 4, '2012-07-17 21:23:00', 7, 6, 1, 0, NULL, 0),
(4271, 1, 'onvergetelijke rijervaring, dankzij de combinatie van een gespierde carrosserievormgeving, de krachtige motoren en een uitzonderlijke wegligging, wat uw bestemming ook is.', 21, '2012-07-17 21:27:48', 7, 6, 1, 0, NULL, 0),
(4272, 1, '030 Driving Dynamics', 2, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4273, 1, 'Rijdynamiek', 1, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4274, 1, 'De combinatie van gewichtsbesparende technieken uit de ruimtevaart, meer vermogen en de ultieme kwaliteit zorgen voor nog betere prestaties.', 19, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4275, 1, 'De sublieme combinatie van vermogen en engineering zorgt voor een opwindende rijervaring. Dankzij de geavanceerde rijeigenschappen en wegligging verbetert de XK uw rijervaring en kunt u alle wegomstandigheden aan.', 29, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4276, 1, 'Jaguar Sequential Shift™', 3, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4277, 1, 'Neem plaats in een XK en de startknop voor de JaguarDrive Selector™ begint rood te pulseren als een hartslag. Druk op de knop om de motor te starten en de JaguarDrive Selector™ rijst op tot in de palm van uw hand. Tegelijkertijd start het navigatiesysteem op en roteren de ventilatieroosters. De automaat laat zich bedienen door simpelweg aan de ''selector'' te draaien, van de Drive naar Sport Mode vergt slechts een simpele druk- en draaibeweging.', 75, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4278, 1, 'JAGUAR DRIVE SELECTOR™ EN JAGUAR DRIVE CONTROL™', 7, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4279, 1, 'De automatische transmissie wordt aangestuurd door de uiterst nauwkeurig vervaardigde JaguarDrive Selector™, een verchroomde draaiknop die tot in de handpalm van de bestuurder rijst zodra de startknop wordt ingedrukt. It offers Drive mode or Sport mode. De bestuurder kan kiezen voor de Drive mode of Sport mode. In de Sport Mode hebt u het volledige vermogen van de motor van uw XK tot uw beschikking, omdat de versnellingen langer worden vastgehouden. Voor totale controle kunt u ook handmatig schakelen, met de schakelhendels achter het stuur.', 85, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4280, 1, 'Daarnaast biedt JaguarDrive Control™ de bestuurder nog twee standen die bij zijn of haar rijvoorkeuren of de omstandigheden passen.', 19, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4281, 1, 'In de Dynamic Mode wordt de reactie van de motor razendsnel bijgesteld waardoor er nog sneller wordt geaccelereerd, voor een fantastische, sportieve rijervaring.', 23, '2012-07-17 21:30:25', 7, 6, 1, 0, NULL, 0),
(4282, 1, 'De Winter Mode dempt automatisch de acceleratie voor meer geleidelijke tractie bij ijzel, zodat de banden meer grip hebben en de kans op glijden wordt verkleind.', 26, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4283, 1, 'WATCH FILM', 2, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4284, 1, 'JAGUARDRIVE SELECTOR™ EN JAGUARDRIVE CONTROL™', 5, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4285, 1, 'De automatische transmissie wordt aangestuurd door de prachtig vormgegeven JaguarDrive Selector™, die tot in de handpalm van de bestuurder rijst zodra de startknop wordt ingedrukt. Dankzij het Jaguar Smart Key System™ met Keyless Start (starten zonder sleutel) moet de bestuurder alleen het rempedaal intrappen om de startknop te activeren. Vervolgens draait de bestuurder gewoon aan de knop om de standen van de automaat te selecteren, of om van Drive naar Sport te schakelen. Voorts geeft de JaguarDrive Control™ de keuze tussen diverse rijmodi - een Dynamic Mode voor responsievere acceleraties en een Winter Mode voor een progressievere controle in gladde omstandigheden.', 101, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4286, 1, 'FILM KIJKEN >', 2, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4287, 1, 'PERFORMANCE-REMMEN', 1, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4288, 1, 'CRUISE CONTROL EN AUTOMATIC SPEED LIMITER', 6, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4289, 1, 'ELEKTRISCHE PARKEERREM', 2, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4290, 1, 'Het remsysteem communiceert met de JaguarDrive Selector™ om de parkeerrem automatisch uit te schakelen wanneer de ''Drive'' stand wordt geselecteerd. De bestuurder kan ook kiezen om de parkeerrem handmatig te bedienen.', 31, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4291, 1, 'OPTIEPACKS XKR', 2, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4292, 1, 'Met de reeks optiepacks voor de XKR krijgen klanten nog meer nog meer mogelijkheden om hun persoonlijke smaak, de prestaties en de individualiteit te benadrukken:  ', 25, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4293, 1, '-          XKR Aerodynamic Pack', 3, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
