(4296, 1, '-          XKR Speed Pack met Black Pack', 6, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4297, 1, '-          XKR Dynamic Pack ', 3, '2012-07-17 21:30:26', 7, 6, 1, 0, NULL, 0),
(4298, 1, '-          XKR Dynamic Pack met Black Pack', 6, '2012-07-17 21:30:27', 7, 6, 1, 0, NULL, 0),
(4299, 1, 'MEER INFORMATIE >  ', 2, '2012-07-17 21:30:27', 7, 6, 1, 0, NULL, 0),
(4300, 1, 'Adaptive Cruise Control (ACC)', 4, '2012-07-17 21:30:27', 7, 6, 1, 0, NULL, 0),
(4301, 1, 'De Adaptive Cruise Control (ACC) gebruikt radartechnologie met microgolven achter de voorbumper om de weg in het oog te houden. Als het systeem merkt dat de voorligger langzamer rijdt, vertraagt ACC de auto door gas te minderen of lichtjes te remmen om zo een constante afstand te bewaren. Zodra de weg weer vrij is, accelereert het systeem automatisch naar de vooraf ingestelde snelheid. Het systeem omvat ook de functie Forward Alert die een akoestisch waarschuwingssignaal geeft als het voorliggende verkeer vertraagt of als een ander voertuig op dezelfde rijstrook komt rijden.', 91, '2012-07-17 21:30:27', 7, 6, 1, 0, NULL, 0),
(4302, 1, 'Elektrisch bedienbare parkeerrem (EPB)', 4, '2012-07-17 21:30:27', 7, 6, 1, 0, NULL, 0),
(4303, 1, 'De XK gebruikt de elektrisch bedienbare parkeerrem van Jaguar. Het remsysteem communiceert elektronisch met de ''shift-by-wire''-technologie van de JaguarDrive Selector™ en ontgrendelt automatisch de parkeerrem  wanneer u de Drive-stand inschakelt. De parkeerrem kan ook handmatig in- en uitgeschakeld worden, mocht dat nodig zijn.', 43, '2012-07-17 21:30:27', 7, 6, 1, 0, NULL, 0),
