(369, 45, 'Flight Centre confirms availability by searching based on the exact itinerary, cabin class & conditions as per the competitors quote. For full terms & conditions & the distinction between cabin class (first & economy) & booking class, see www.flightcentre.co.uk Offer is subject to change at any time. Travel restrictions & conditions apply. Please ask us for further details. Prices & taxes are correct as of 31 Jan 12 & are subject to change without notice. Prices are return per person & are subject to limited availability. All flights depart London & include prepaid taxes & fuel charges. Seasonal surcharges may apply depending on date of travel. Airline Failure Protection & booking fees apply. ', 'Flight Centre confirms availability by searching based on the exact itinerary, cabin class & conditions as per the competitors quote. For full terms & conditions & the distinction between cabin class (first & economy) & booking class, see www.flightcentre.co.uk Offer is subject to change at any time. Travel restrictions & conditions apply. Please ask us for further details. Prices & taxes are correct as of 31 Jan 12 & are subject to change without notice. Prices are return per person & are subject to limited availability. All flights depart London & include prepaid taxes & fuel charges. Seasonal surcharges may apply depending on date of travel. Airline Failure Protection & booking fees apply. ', 0),
