(341, 44, 'Economy INSERT INTO `task_import_rows` (`id`, `import_id`, `source`, `target`, `imported`) VALUES
(1261, 65, 'TEST', 'テスト', 1),
(1260, 65, 'TEST', 'テスト', 1),
