(1273, 66, '019 F-TYPE Press Release', 'Press Release 019 F-TYPE', 1),
(1274, 66, 'JAGUAR ANNOUNCES ALL-NEW SPORTS CAR: THE JAGUAR F-TYPE', 'JAGUAR ANUNCIA ALL-novo carro esportivo: O Jaguar F-Type', 1),
(1275, 66, 'Today at the New York International Auto Show, Jaguar formally announced that an all-new sports car will enter production; the Jaguar F-TYPE.', 'Hoje, no New York Internacional Auto Show, a Jaguar anunciou formalmente que um novo carro esporte vai entrar em produção, o Jaguar F-Type.', 1),
(1276, 66, 'NEW YORK (April 4, 2012) – Today at the New York International Auto Show, Jaguar formally announced that an all-new sports car will enter production; the Jaguar F-TYPE.  A true two-seat sports car, the Jaguar', 'NOVA YORK (4 de abril de 2012) - Hoje, no New York Internacional Auto Show, a Jaguar anunciou formalmente que um novo carro esporte vai entrar em produção, o Jaguar F-Type. Um verdadeiro dois-assento de carro esportivo, o Jaguar', 1),
(1277, 66, 'F-TYPE will launch as a convertible becoming the fourth model in the current line of innovative and seductive cars, along with the XF sports sedan, the XJ luxury sedan and the XK coupe/convertible.', 'F-TYPE lançará como um conversível tornando-se o quarto modelo da linha atual de carros inovadores e sedutor, junto com o sedã esportivo XF, o sedã de luxo XJ eo cupê XK / conversível.', 1),
(1278, 66, 'Benefitting from Jaguar''s leading expertise in aluminum vehicle construction, the Jaguar F-TYPE will focus uncompromisingly on delivering a rewarding drive experience.  A range of engines will be available, including a new powerplant family.  All will deliver stunning sports car performance.', 'F-TYPE lançará como um conversível tornando-se o quarto modelo da linha atual de carros inovadores e sedutor, junto com o sedã esportivo XF, o sedã de luxo XJ eo cupê XK / convertible.Benefitting da perícia levando Jaguar na construção de veículos de alumínio, o Jaguar F-Type incidirá intransigente em entregar uma experiência de unidade gratificante. A gama de motores estará disponível, incluindo um novo motor da família. Tudo vai proporcionar um desempenho impressionante carro esporte.', 1),
(1279, 66, 'Speaking at the New York auto show Adrian Hallmark, Global Brand Director, Jaguar Cars, confirmed: "We showed the C-X16 concept in September 2011, and the reaction to it has been so positive that we''ve accelerated our development of an all-new Jaguar sports car. That car will be called the Jaguar F-TYPE, and it will be unveiled in production form later this year. The core appeal of Jaguar''s cars is their sporting heart, and that heart will beat stronger than ever before in the F-TYPE. Its development is a vivid representation of the confidence and ambition of the Jaguar brand, and the desire amongst our engineers and design team to produce a world-leader in a market segment that we have been absent from for too long. But no longer, the F-TYPE is coming."', 'Falando no New York Auto Show Adrian Hallmark, diretor de Marca Global da Jaguar Cars, confirmou: "Nós mostramos o conceito C-X16 em setembro de 2011, ea reação a ele tem sido tão positiva que nós aceleramos nosso desenvolvimento de um todo -nova Jaguar carro esporte. esse carro vai ser chamado de Jaguar F-Type, e ele será revelado em forma de produção ainda este ano. o apelo do núcleo dos carros da Jaguar é o seu coração desportivo, e que o coração vai bater mais forte do que nunca na o F-TYPE. o seu desenvolvimento é uma representação viva da confiança e ambição da marca Jaguar, eo desejo entre os nossos engenheiros e equipe de design para produzir um líder mundial em um segmento de mercado que estiveram ausentes por muito tempo. mas não, o F-TYPE está chegando. "', 1),
(1280, 66, 'This day also marks the point at which the rigorous development program for the Jaguar F-TYPE moves into the final road testing phase. Engineering prototypes are now being placed into service at Jaguar''s Castle Bromwich plant in the British Midlands. This is the same plant at which will build the production car.', 'Este dia também marca o ponto em que o programa de desenvolvimento rigoroso para os F-TIPO Jaguar move-se na fase final estrada teste. Protótipos de engenharia estão agora a ser colocado em serviço na fábrica da Jaguar em Castle Bromwich Midlands britânicos. Esta é a mesma planta em que vai construir o carro de produção.', 1),
(1281, 66, 'Ian Hoban, Jaguar''s Vehicle Line Director said: "The engineering development of the F-TYPE has focused on delivering a heightened level of dynamic driving reward. We are excited about our progress to date and are looking forward to soon being able to demonstrate what we have achieved."', 'Ian Hoban, Director da Jaguar da Linha de Veículos, disse: "O desenvolvimento de engenharia da F-TYPE foi focada em fornecer um alto nível de recompensa de condução dinâmica Estamos entusiasmados com o nosso progresso até à data e esperamos em breve ser capaz de demonstrar que nós. tem alcançado. "', 1),
(1282, 66, 'Ian Callum, Director of Design, said: "A true sports car needs to be pure in both its purpose and its form; to have the opportunity to produce such a car for Jaguar has been a privilege both for myself and for my team. The C-type, D-type and E-type Jaguars were all sports cars that held true to this principle in their era, and the F-TYPE will hold true to that same principle in its time, a time that is soon to arrive."', 'Ian Callum, Director de Design, disse: "Um verdadeiro carro esporte precisa ser puro tanto na sua finalidade e sua forma, ter a oportunidade de produzir um carro para a Jaguar foi um privilégio tanto para mim e para minha equipe. tipo C, D e e do tipo tipo Jaguars eram todos os carros esportivos que era verdade a este princípio em sua época, eo F-TYPE manterá fiel a esse mesmo princípio em seu tempo, uma vez que está prestes a chegar. "', 1),
(1283, 66, 'Full Jaguar F-TYPE technical and model range details will be announced later in 2012.  It will go on sale in mid-2013.', 'Completo Jaguar F-TYPE detalhes alcance técnicas e modelo serão anunciados mais tarde, em 2012. Ele estará à venda em meados de 2013.', 1),
