(1396, 72, 'Jaguar to reveal latest sports car concept, the C-X16 at this year’s Frankfurt Motor Show >', 'Jaguar zu offenbaren neuesten Sportwagen-Konzept, das C-X16 auf der diesjährigen IAA in Frankfurt>', 1),
(1397, 72, 'This year’s Frankfurt Motor Show will be the first public appearance of Jaguar’s exciting new sports car concept, the C-X16.', 'Die diesjährige IAA in Frankfurt wird der erste öffentliche Auftritt von aufregenden neuen Jaguar-Sportwagen-Konzept, das C-X16 sein.', 1),
(1398, 72, 'Jaguar''s two-seat concept is a new breed of Jaguar sports car that aims to set a new class benchmark for design, vehicle dynamics and technology.', 'Jaguar-Zweisitzer-Konzept ist eine neue Generation von Jaguar-Sportwagen, der um eine neue Klasse Maßstäbe für Design, Fahrdynamik und Technologie setzen will.', 1),
(1399, 72, 'As one of the world’s largest motor shows, Frankfurt has seen the launch of many of the world’s most exciting cars. The C-X16 will be no exception and will be on view throughout this year’s show, which is open to the public from 13th September – 25th September, 2011.', 'Als einer der weltweit größten Automessen, Frankfurt hat den Start von vielen der weltweit aufregendsten Autos gesehen. Der C-X16 wird keine Ausnahme sein und wird auf Sicht während der diesjährigen Messe, die für das Publikum geöffnet vom 13. September ist sein - 25. September 2011.', 1),
(1400, 72, 'If you’re lucky enough to be in Frankfurt at the time, you can find Jaguar in Hall 5, Stand B22.', 'Wenn Sie Glück haben, in Frankfurt an der Zeit sein, sind, können Sie Jaguar in Halle 5, Stand B22.', 1),
(1401, 72, 'As well as the live reveal, our Facebook page will have lots of exciting news, exclusive behind the scenes images and reaction to the car from Jaguar enthusiasts all over the world. If you are at this year’s event, please feel free to share some of your images with us.', 'Neben der Live-zeigen, werden unsere Facebook-Seite haben viele spannende Neuheiten, exklusive Bilder hinter den Kulissen und Reaktion auf das Auto von Jaguar-Enthusiasten auf der ganzen Welt. Wenn Sie bei der diesjährigen Veranstaltung sind, zögern Sie nicht, einige Ihrer Bilder mit uns zu teilen.', 1),
