(1431, 74, 'Jaguar XF Sportbrake. The versatility of a luxury estate car, the spirit of a sports car and the craftsmanship of a luxury saloon. Click here to find out more.', '재규어 XF Sportbrake.럭셔리 부동산 자동차의 다양성, 스포츠카와 럭셔리 살롱의 장인 정신. 자세한 내용을 보려면 여기를 클릭하십시오.', 1),
(1432, 74, 'Jaguar XF Sportbrake. Combining the performance and craftsmanship of the award-winning XF range with the space and practicality of a luxury estate, that can easily fit into the needs of the most active lifestyles.', '재규어 XF Sportbrake. 쉽게 가장 활동적인 라이프 스타일의 요구에 맞게 수있는 호화 저택의 공간과 실용성있는 수상 경력에 빛나는 XF 범위의 성능과 장인 정신을 결합하여.', 1),
