(1468, 76, 'There is a wide range of Jaguar accessories available for your XF touring, all of which can be fitted by a Jaguar dealer. Find out more.', 'Có một loạt các phụ kiện có sẵn Jaguar XF du lịch của bạn, tất cả đều có thể được trang bị bởi một đại lý Jaguar. Tìm hiểu thêm.', 1),
(1469, 76, 'Safety and specialist storage devices that can help you make the most of your XF.', 'An toàn và chuyên gia thiết bị lưu trữ có thể giúp bạn tận dụng tối đa của XF của bạn.', 1),
