(1479, 76, 'Textile traction aids that can be quickly fitted to tyres for improved road-holding in snow and ice. A convenient option in snow and ice.', 'Dệt may kéo viện trợ có thể được nhanh chóng trang bị cho lốp giữ đường bộ được cải thiện trong tuyết và băng. Một lựa chọn thuận tiện trong tuyết và băng.', 1),
(1480, 76, 'View large image >', 'Xem hình ảnh lớn>', 1),
(1481, 76, 'Find out more >', 'Tìm hiểu thêm>', 1),
(1482, 76, 'Car Cover', 'xe Che phủ', 1),
(1483, 76, 'All weather car cover. A convenient way of protecting your Jaguar from the elements, including showers, frost and dust. Tailored to the XF, it is quick and easy to fit.', 'Bao gồm tất cả các xe thời tiết. Một cách thuận tiện để bảo vệ Jaguar của bạn từ các yếu tố, bao gồm cả vòi hoa sen, sương giá và bụi. Phù hợp với các XF, nó là nhanh chóng và dễ dàng để phù hợp.', 1),
(1484, 76, 'Luggage Compartment Liner', 'Hành lý khoang Liner', 1),
(1485, 76, 'This Jaguar branded part is designed to protect the load space area of the boot. This product is easily', 'Điều này một phần mang nhãn hiệu Jaguar được thiết kế để bảo vệ các khu vực không gian tải khởi động. Sản phẩm này có thể dễ dàng', 1),
(1486, 76, 'removed and cleaned.', 'loại bỏ và làm sạch.', 1),
(1487, 76, 'Spike Spyder Traction System', 'Hệ thống kéo Spike Spyder', 1),
(1488, 76, 'High grip traction system for driving in snow, muddy or icy conditions.', 'Nắm kéo hệ thống cho các lái xe trong tuyết, điều kiện bùn hay băng giá.', 1),
(1489, 76, 'Fits XF wheel sizes up to and including 20" diameter.', 'Phù hợp với kích thước bánh xe XF cho đến và bao gồm 20 "đường kính.', 1),
(1490, 76, 'Locking Wheel Nuts', 'Khóa Nuts Wheel', 1),
(1491, 76, 'To provide effective security for wheels', 'Để cung cấp bảo mật hiệu quả cho các bánh xe', 1),
(1492, 76, 'Splash guards', 'Splash bảo vệ', 1),
(1493, 76, 'A set of front and rear Jaguar branded splash guards styled to complement the design of the vehicle. These guards have been developed to protect the vehicle from dirt and stone chipping.', 'Một bộ phía trước và phía sau giật gân Jaguar bảo vệ thương hiệu theo kiểu để bổ sung cho thiết kế của chiếc xe. Những bảo vệ này đã được phát triển để bảo vệ xe tránh bụi bẩn và đá sứt mẻ.', 0),
(1494, 76, 'Not available for XFR or with R Performance Aerodynamic Pack.', 'Không có cho XFR hoặc với R Hiệu suất khí động học Pack.', 1),
(1495, 76, 'Detachable Tow Bar and Towing Electric', 'Bar Tow có thể tháo rời và kéo điện', 1),
(1496, 76, 'Detachable tow bar and ball hitch engineered for the Jaguar XF. The ball hitch is easily removed when not in use without the need for tools. The lockable ball facility adds further security.', 'Thanh kéo có thể tháo rời và xô bóng thiết kế cho Jaguar XF. Các xô bóng có thể dễ dàng loại bỏ khi không sử dụng mà không cần phải cho các công cụ. Các khóa bóng cơ sở cho biết thêm bảo mật hơn nữa.', 1),
(1497, 76, 'Maximum towing weight: 2000 kg (4409 lbs)', 'Kéo trọng lượng tối đa: 2000 kg (4409 lbs)', 1),
(1498, 76, 'Towing electrics used in conjunction with the Jaguar approved Towing systems. Fully integrated into the vehicle.', 'Kéo linh kiện điện được sử dụng kết hợp với hệ thống Jaguar được phê duyệt kéo. Tích hợp đầy đủ vào xe.', 1),
(1499, 76, 'These kits enable all primary exterior lighting/auxiliary functions.', 'Các bộ dụng cụ này cho phép tất cả các ánh sáng bên ngoài chính / phụ trợ chức năng.', 1),
(1500, 76, 'Jaguar offers a selection of child seats that provide safety with style.  There is a child seat for all ages from infant carriers for babies from birth, to booster cushions suitable for older children, with removable, washable covers and simple installation.  A range of child restraint applications as below:', 'Jaguar cung cấp một lựa chọn chỗ ngồi trẻ em cung cấp an toàn với phong cách. Có một ghế trẻ em cho mọi lứa tuổi từ tàu sân bay cho trẻ sơ sinh cho trẻ sơ sinh từ khi sinh ra, để tăng cường đệm phù hợp cho trẻ em nhiều tuổi hơn, di động, bao gồm rửa được và cài đặt đơn giản. Một loạt các ứng dụng hạn chế trẻ em như sau:', 1),
(1501, 76, '- Child Seat (9kg – 18kg)', '- Ghế trẻ em (9 kg - 18 kg)', 1),
(1502, 76, '- Booster Cushion (15kg-36kg)', '- Booster Cushion (15kg-36kg)', 1),
(1503, 76, '- Infant Carrier (birth – 13kg)', '- Nhà cung cấp trẻ sơ sinh (sinh - 13kg)', 1),
(1504, 76, '- Infant Carrier ISOFIX Base', '- Trẻ sơ sinh nhà cung cấp cơ sở ISOFIX', 1),
(1505, 76, '*Recommended when using the Infant Carrier.', '* Được giới thiệu khi sử dụng các nhà cung cấp trẻ sơ sinh.', 1),
(1506, 76, 'Refer to the Owners Handbook and the Child Seat Fitting Instructions before fitting child seats.', 'Tham khảo Cẩm nang Chủ sở hữu và Hướng dẫn ghế trẻ em Lắp Đặt trước chỗ ngồi trẻ em phù hợp.', 1),
(1507, 76, 'Colours and/or fabrics may vary from shown.', 'Màu sắc và / hoặc các loại vải có thể khác nhau từ hiển thị.', 1),
(1508, 76, 'Warning Triangle', 'Cảnh báo Tam giác', 1),
(1509, 76, 'Two-tone reflective triangle for both day and night use. Fits inside the boot and can be erected within seconds outside the vehicle in case of emergency.', 'Hai tông màu phản chiếu hình tam giác sử dụng cho cả ngày và đêm. Phù hợp với bên trong khởi động và có thể được xây dựng trong vòng vài giây bên ngoài xe trong trường hợp khẩn cấp.', 1),
(1510, 76, 'First Aid Kit', 'Hỗ trợ đầu tiên Kit', 1),
(1511, 76, 'A comprehensive kit useful for dealing with minor emergencies.', 'Một bộ dụng cụ toàn diện hữu ích để đối phó với các trường hợp khẩn cấp nhỏ.', 1),
